}

header:hover {
    background-color: #fff;

}

header:hover a {
    color: black !important;
}

.head_up {
    position: absolute;


}

.head_down {
    position: fixed;
}

.header_wrap {
    display: flex;
    justify-content: space-between;
    align-items: center;


}

.head_logo {
    width: 33.3333%;
}

.head_logo .imgwrap {
    width: 90px;
    margin-left: 25px;
    margin-top: 10px;

}

.head_logo .imgwrap img {
    width: 100%;
    height: auto;
}

.head_lnb {
    width: 33.3333%;
}

.head_lnb ul {
    display: flex;
    justify-content: space-around;
     line-height: 70px;
}

.head_lnb ul li {
    font-size: 20px;
    font-weight: bold;

}

.head_lnb ul li:nth-child(4) {
    position: relative;
}

.head_lnb ul li:nth-child(4)::before {
    content: "";
    display: block;
    width: 1px;
    height: 14px;
    background-color: #ccc;
    position: absolute;
    top: 25px;
    left: -35px;

}

.head_lnb ul li a {
    display: block;
    width: 100%;
    color: #fff;
    position: relative;
    transition: .3s;

}

.head_lnb ul li a:hover {
    color: #002053;
}

.head_lnb ul li a:hover::after {
    width: 50%;
}

.head_lnb ul li a:hover::before {
    width: 50%;
}

.head_lnb ul li a::after {
    display: block;
    content: "";
    width: 0%;
    height: 2px;
    background-color: #002053;
    position: absolute;
    bottom: 13px;
    right: 50%;
    transition: .3s;
}

.head_lnb ul li a::before {
    display: block;
    content: "";
    width: 0%;
    height: 2px;
    background-color: #002053;
    position: absolute;
    bottom: 13px;
    left: 50%;
    transition: .3s;
}

.head_gnb {
    width: 33.3333%;

}

.head_gnb ul {
    display: flex;
    justify-content: flex-end;
}

.head_gnb ul li {
    margin-right: 25px;
    position: relative;

}

.head_gnb ul li:nth-child(4) {}

.head_gnb ul li .count {
    width: 20px;
    height: 20px;
    line-height: 20px;
    display: block;
    background-color: #002053;
    border-radius: 50%;
    text-align: center;
    color: #fff;
    font-size: 13px;
    position: absolute;
    top: 10px;
    right: -5px;

}

.head_gnb ul li a {
    width: 100%;
    display: block;
    font-size: 25px;
    color: #fff;
    transition: .3s;

}

.header:hover .head_lnb>ul>li>a {
